            }  

                .Contact-IntroSlide {
                    position: absolute;
                    width: 50%;
                    height: 100%;
                    top: 0;
                    bottom: 0;
                    background-color: rgb(240, 240, 240);
                    transition: all;
                    z-index: 1;
                }
                    .Contact-IntroSlideLeft {
                        left: -100%;
                    }

