                    }


//Contact
.Contact {
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
}

    .Contact-Wrapper {
        width: 100%;
        width: 100%;
        position: relative;
        padding: 0 10%;

    }

        .Contact-Title {
            margin-top: 100px;
            font-size: 75px;
            font-weight: 900;
            font-family: aktiv-grotesk-condensed, sans-serif;
            text-transform: uppercase;
            transition: all .5s ease-in-out;
        }

            .Contact-Subtitle {
                font-size: 55px;
                font-weight: 200;
                font-family: aktiv-grotesk-condensed, sans-serif;
                text-transform: uppercase;
                margin-bottom: 80px;
                transition: all .5s ease-in-out;
            }

                .Contact-Content {
                    width: 100%;
                    padding-left: 10%;
                    margin-bottom: 80px;
                }

                    .Contact-Section-Title {
                        font-size: 40px;
                        font-weight: 900;
                        font-family: aktiv-grotesk-condensed, sans-serif;
                        text-transform: uppercase;
                        transition: font-size .5s ease-in-out;
                    }

                        .Contact-Section-Text {
                            font-size: 16px;
                            font-weight: 300;
                            margin-bottom: 20px;
                        }

                        .Contact-Link {
                            padding-right: 15px;
                        }
                            .Contact-Link:hover {
